import React from 'react'
import Header from '../components/Header/Header'
import Slider from '../components/Slider/Slider'

const Main = () => {
  return (
    <div className='pt-[90px] px-4 w-[100%]'>
        <Header />
        <Slider />
    </div>
  )
}

export default Main
